import React, { Component } from 'react';
import Background from './assets/yakult.jpg';
import './App.css';
class App extends Component {
  render() {
    return (
      <div>Test</div>
    )
  }
}
let h = window.innerHeight;

const styles = {
  wrapper: {
    display: "flex",
    backgroundImage: `url(${Background})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    height: "100%",
    backgroundPosition: "center",
  },
  parent: {
    height: h,
    width: "100%",
    display: "flex",
  },
  parentText: {
    margin: "auto",
  },
  parentIcon: {
    margin: "auto",
  }
}

export default App;
